
drop table tempfirmtable;

-- CREATE TEMPORARY TABLE IF NOT EXISTS tempfirmtable AS (
CREATE TABLE IF NOT EXISTS tempfirmtable AS (
select distinct CL.FIRM, count(CL.ID) as FIRMCOUNT
from 
rcb_tclients as CL 
where
(firm not like 'prepaid%' and firm not like 'intelvision' and firm not like 'closed%' and CL.FIRM not like '%close%')
group by CL.FIRM
order by 2 desc
-- LIMIT 100
)
;

drop table tempfirmtable2;
CREATE TEMPORARY TABLE IF NOT EXISTS tempfirmtable2 AS (
SELECT * from tempfirmtable limit 100
);

drop table tempclientcontracttable;

CREATE TABLE IF NOT EXISTS tempclientcontracttable AS (
SELECT 
CL.ID AS CL_CLIENTID,
CL.FIRM AS CL_CLIENTNAME,
CL.KOD AS CL_CLIENTCODE,
CL.DANNO AS CL_SSN,
CL.PASSNO AS CL_PASSPORT,
CL.ADDRESS AS CL_ADDRESS,
CL.MPHONE AS CL_PHONE,
CL.BEGDATE AS CL_STARTDATE,
CL.CLTYPE AS CL_CLIENTTYPE,
CL.CLCLASS AS CL_CLIENTCLASS,
CL.ACTIVE AS CL_CLIENTACTIVE,

CON.ID AS CON_CONTRACTID,
CON.KOD AS CON_CONTRACTCODE,
CON.CLID AS CON_CLIENTID,
CON.STARTDATE AS CON_STARTDATE,
CON.ENDDATE AS CON_ENDDATE,
CON.RATINGPLANID AS CON_RATINGPLANID,
CON.ACTIVE AS CON_ACTIVE,
CON.CREDITPOLICYID AS CON_CREDITPOLICYID




,IC.ID AS IC_ID
,IC.INVOICENO AS IC_INCOICENO
,IC.CLID AS IC_CLIENTID
,IC.CID AS IC_CONTRACTID
,IC.SCOST AS IC_SCOST
,IC.COST AS IC_COST
,IC.SUMCOST AS IC_SUMCOST
,IC.COSTVAT AS IC_VATCOST
,IC.COSTTOTAL AS IC_TOTALCOST
,IC.FROMDATE AS IC_FROMDATE
,IC.TODATE AS IC_TODATE
,IC.TEXT AS IC_SUBSCRIPTION
,IC.UPDDATE AS IC_UPDDATE
,IC.INVOICEID AS IC_INVOICEID

from 
rcb_tclients as CL
left join
rcb_contracts as CON
on
CL.ID=CON.CLID


left join
rcb_invoicescontents as IC
on
CON.ID=IC.CID

where  
CL.FIRM in (select FIRM from tempfirmtable2)

-- CL.ID=723711

-- (CL.FIRM not like 'prepaid%' and CL.FIRM not like 'intelvision' and CL.FIRM not like 'closed%' and CL.FIRM not like '%close%')


order by CL.FIRM, CL.ID, CON.ID, CON.StartDate, IC.UPDDATE, IC.INVOICENO, IC.FROMDATE
);


